import * as React from 'react';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';
import CheckCircleOutlineIcon from '@mui/icons-material/CheckCircleOutline';

export default function Success({open,setOpen}) {


  const handleClose = () => {
    setOpen(false);
    clearTimeout(timeout);
    timeout = setTimeout(() => {
      if (searching !== '') {
        const formData = new FormData();
        formData.append('search', searching);
        axios
          .post('https://doctor-care.smartedge.me/api/search', formData)
          .then((res) => {
            if (res.data.message === 'No services found!') {
              setMessage(res.data.message);
              setSearchMenu(false);
              setAlerting(true);
            } else {
              setSearchingRes(res.data.data);
              setSearchMenu(true);
            }
          })
          .catch((error) => {
            console.error(error);
          });
      }
    }, 1000); 
  };
  let timeout;

  return (
    <React.Fragment>
      <Dialog
        open={open}
        maxWidth='sm'
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogContent sx={{display:'flex',flexWrap:'wrap',justifyContent:'center',alignItems:'center'}}>
        Your request has been successfully submitted.
        <CheckCircleOutlineIcon sx={{color:'lightgreen',marginLeft:'5px',height:'20px',width:'20px'}}/>
        </DialogContent>
      </Dialog>
    </React.Fragment>
  );
}
